import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const NavBar = () => {
    return (
        <Navbar expand="lg">
            <Container>
                <Navbar.Brand>
                    <Link to="/">
                        {/* Your logo image or text */}
                    </Link>
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link as={Link} to="/" activeClassName="active">Home</Nav.Link>
                        <Nav.Link as={Link} to="/skills" activeClassName="active">Skills</Nav.Link>
                        <Nav.Link as={Link} to="/experience" activeClassName="active">Experience</Nav.Link>
                        <Nav.Link as={Link} to="/projects" activeClassName="active">Projects</Nav.Link>
                    </Nav>
                    <span className="navbar-text">
                        <div className="social-icon">
                            {/* Your social media links */}
                        </div>
                        <Link to="/contact">
                            <button className="vvd">
                                <span>Let's Connect</span>
                            </button>
                        </Link>
                    </span>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
};

export default NavBar;
